            policy_shipping: "We are working hard to have your order shipped out as soon as possible. Please note that it will not always be on the same day the order was placed. Depending on our work load, the processing time may vary from 1 to 10 business days. Feel free to contact us if you would like to find out the lead time for a specific item you are interested in. Need your items ASAP?? Purchase the &quot;Rush My Order&quot; listing below for your items to be processed and shipped within 1-2 business days: https://www.etsy.com/listing/197939890/rush-order-bump-me-to-the-front-of-the?ref=shop_home_active_19 DOMESTIC SHIPPING We use USPS First Class, USPS Priority mail, and FedEx Ground shipping destinations within the US. The amount of time it takes to receive the delivery depends on the carrier. Unfortunately, once the order leaves our workshop, we have no control over their accuracy or delays in shipping. You can find the estimated time for delivery on the carrier website. Please make sure to you specified correct shipping address before completing check out as this is the exact address we will ship your order to. INTERNATIONAL SHIPPING All international orders are shipped via USPS First Class Mail. Please note that you won’t be able to track your package once it leaves the U.S. using USPS tracking number provided. Delivery time varies by destination and depends on foreign Customs processing time. We are not responsible for lost, stolen, or damaged during the shipment items. Please be advised that all packages are insured. If you received damaged item, please contact us for further instructions on how to receive your compensation. CUSTOMS CHARGES It is the customers responsibility to contact the local customs, the courier office regarding any additional and applicable customs, duties, or Vat charges. If you have any questions or concerns, please do not hesitate to contact us",
