            login_name: "SummitEngravingLtd",
            accepts_custom_requests: false,
            policy_welcome: "Thank you for shopping with us. Summit Engraving Ltd features personalized engraved gifts and favors for every occasion. Wedding, Birthday, Anniversary, Graduation, House Warming, Bon Voyage, Favors We Specialize in: Personalized Wedding Gifts, Personalized Groomsmen Gifts, Personalized Bridesmaids Gifts, Personalized gifts for the Bride and Groom, Personalized Picture Frames, and more ☆¸¸.☆¸¸.☆ Thank you for shopping with us! ☆¸¸.☆¸¸.☆ ~Amy",
            policy_payment: "Summit Engraving Ltd accepts payment via direct checkout or PayPal. If you are paying by PayPal eCheck, we do reserve the right to hold shipping until payment has cleared. Thanks for shopping with us, we truly appreciate your business, and your satisfaction is why we do what we do.",
            policy_shipping: "We typically ship via USPS First Class Mail or USPS Priority Mail unless otherwise noted. Please note that we cannot guarantee specific delivery dates and/or times as USPS offers only delivery estimates and that delivery is out of our control once received by the post office. For this reason, please allow ample time for us to personalize your item and ship it to you so that you receive it with time to spare. ",
            policy_refunds: "All of our products are custom made to order. This being the case, we consider all of our products to be custom products, and we do not have the ability to exchange a product once it is produced. To that end we are committed to making sure you receive exactly what you ordered. If there is any mistake made on our part, or any issue with defects in materials and/or workmanship, we will stand behind our products 100%. In such rare circumstance we will gladly and speedily replace said item, or provide a refund, as you prefer.",
            policy_additional: "BREAKAGE POLICY We go to great lengths to be sure your purchase and products arrive safe and sound. As shipping is completely out of our control, breakage does sometimes occur. ALL DAMAGE CLAIMS MUST BE MADE WITH 48 HOURS OF DELIVERY SHOWN ON TRACKING NUMBER (usually USPS). We will file a shipping claim on your behalf and work to get you a replacement as soon as possible. PLEASE NOTE that ALL CARRIERS REQUIRE photographs of the packing material AND the damage items, SHOWING PERSONALIZATION, where applicable. Work or replacement items cannot begin until we have required photographs. OAK BARREL INFO: There are lots of oak barrel makers out there (with lots of different theories and practices) and there is lots of info on the Web. We suggest learning more if you have specific questions. Here are some helpful tips we found online (this is just a general summary of information and not meant to be complete): • As the barrels are a wood product, they are subject to the wood drying and shrinking. • In order for the spigot to flow freely, please remember to remove the bung/cork before you open the spigot ... pour from the spigot ... then close the spigot and finally ... replace the bung/cork. • To keep your barrels performing and looking their best, please keep them stored in a protected area away from the elements and optimally in a cool and relatively humid area. • Barrels with painted black steel hoops are particularly susceptible to moisture. A little care goes a long way. Prevent excessive staining and rust by keeping the exterior of the barrel dry. • Avoid water stains by using a funnel to carefully fill your new barrel. • Sandpaper will generally remove any stains or marks on the barrel. • As the barrels are handcrafted, liquid volume is approximate. • You should be able to reuse your barrel from 3-5 times ... remember that each aging will take longer than the previous one. • Please do not nail or put screws into the hoops or staves as doing so will compromise the oak and might cause damage. • If you want to age a different type of spirit then was initially aged in it, we recommend you use a new barrel. • For your safety, if using chemicals to clean/sanitize your barrels, please follow the manufacturer’s instructions for proper use. • The spirit can age anywhere from one week to one-year, but it&#39;s recommended that you take a small taste test every two weeks. Remember to only take a small taste to ensure the top of the barrel does not get dry to avoid leaking and losing your spirit to the &#39;Angel&#39;s Share.&#39; Once the spirit reaches your perfect taste, empty the spirit into a decanter and restart the process! Angel’s Share. Angel’s Share is a fancy name for evaporation. Since mini-barrel staves are thinner than normal distillery size 53-gallon barrel staves, there is a higher “angel’s share”, thus higher evaporation. To avoid this evaporation, make sure you follow the instructions and 1) fill the barrel to the very top when first filling the barrel with your spirit; and 2) keep the top of the barrel moist after using the barrel by rolling the liquid around every couple of days. As previously mentioned, we recommend taking very small taste-tests every two weeks to ensure much of the top of the barrel does not become dry.&quot; Storing your Empty Barrel After Initial Use Ideally, your barrel would always be filled. Used barrels require no special preparation beyond a simple water rinse, if desired, when transferring out and in immediately. If used barrels are to be stored empty, rinse them several times with clean water, and drain thoroughly. Remove the spigot and bung to promote air flow and store out of sunlight and in a cool (55° – 60°) and optimally humid (65% - 75%) area. An alternative is to fill and store barrels with a sulfur-citric holding solution (recipes are online). This holding solution promotes sanitation and keeps the barrels swelled and smelling sweet however ... it will strip some of the oaks flavors. For your safety and the safety of your family, always follow manufacturers’ guidelines and instructions for the proper use of chemicals. ",
