            digital_listing_count: 0,
            login_name: "AKLaser",
            accepts_custom_requests: false,
            policy_welcome: "Welcome to our shop and thank you for visiting! If you have questions, concerns and/or issues please do not hesitate to contact us!! Our contact information is via &#39;Etsy conversation&#39; -we check our Etsy messages hourly during normal business hours and every few hours on weekends. We also receive phone calls during normal business hours. ",
            policy_payment: "We accept PayPal and credit card payment in US Dollars. Payment must be made in full and have cleared before the item is shipped. Washington State residents will be charged sales tax of 8.4% upon checkout. ",
            policy_shipping: "Most orders will be processed, and packages shipped within 5 business days, unless mentioned otherwise in our shop banner, listing&#39;s description or order form receipt. Packages will be shipped to the name and address that you provided in your PAYPAL or Etsy account. We ship through the UNITED STATES POSTAL SERVICE (USPS). In the United States, we ship packages First Class Mail, Priority Mail or Parcel Select (Ground). The following shipping delivery times are estimates: ***Packages shipped First Class Mail can be expected in 2-5 days; ***Priority Mail (2-3 days or more during holidays); ***Parcel Select (2-9 days). Most of our flask sets are shipped USPS Parcel Select. All packages of orders purchased from within the U.S. are tracked to their destination. If you require a RUSH ORDER, please message us before you order so we can tailor your needs to the appropriate USPS shipping delivery method. We process rush orders in 1 to 2 days and packages can be expected within 3 or 4 business days. This may include a guaranteed delivery time in the U.S, depending on the shipping upgrade that is purchased. INTERNATIONAL ORDERS are welcome for all of our shop listings! International packages are shipped USPS First Class International or Priority Mail International (if packages weigh over 4 pounds). First Class International packages can take up to 4 weeks for delivery. Packages shipped Priority International can be expected in 6-11 days. Please order early. Contact us via Etsy conversations -if questions. INTERNATIONAL packages shipped internationally are TRACKED ONLY to the International sorting center in the U.S. INTERNATIONAL CUSTOMERS will be responsible for all fees imposed by their countries. These fees include and are not limited to IMPORT TAXES, VAT and/or handling fees. The fees, may be applied on different imported merchandise by your countries and post offices and are collected at the time of customs clearance. Your merchandise/package may be held at your local (Post Office) or other location until the fees are paid. Our listing&#39;s shipping prices do not include any of the aforementioned fees. To our shop visitors from the UK -please review the following information (in the link provided below) before purchasing our items: www.hmrc.gov.uk/customs/post/buying.htm#3 Below is a sample of fees charged for four flask sets to the UK: £10.32 in VAT; £8 Royal Mail international handling fee; Total £18.32 plus the cost of the four flask sets. (The above was received from a customer of the UK in 2014). All packages will be shipped with the full value (item price) and as merchandise. We will email you when your package has shipped. ",
            policy_refunds: "We are very sorry that we can not give refunds for personalized engraved merchandise. Still, please message us, we are sometimes willing to work out something!! If there is a mistake with our engraving, or a problem with the merchandise, please contact us via &#39;Etsy conversations&#39; within five days of receiving your package. We will only read engraving information if it is written in the note box on the order form, or if it references an e-mail or &#39;&#39;Etsy conversation&quot;. ",
            policy_additional: "Please make sure when you order that all ENGRAVING INSTRUCTIONS are written in the &#39;note box&#39; on the &#39;add to cart &#39; page, and all names, titles and wedding dates and other information if required are correct. We do not provide PROOFS of personalization for any of the engraving designs listed in our shop. For most orders we will engrave exactly or close to what is requested on the order form, except for two exceptions, i.e., if the customer requests that &quot;Groomsmen&quot; or &quot;Bestman&quot; be engraved for a flask or knife order, we will engrave &quot;Groomsman&quot; and &quot;Best Man&quot;. Dates will be engraved exactly or close to what is pictured. All of the ENGRAVED IMAGES on the flasks are intellectual property, created by us. All of our shop&#39;s listing PHOTOS and NARRATIVE are Intellectual Property. Copying our images, photos or narrative is intellectual property right infringement. +++Please wash the engraved FLASKS and shot cups (by hand) thoroughly inside and out before using. WHEN YOU ORDER from AKLASER, you understand and agree to our shop policies.",
            policy_seller_info: "Our studio is located at Battle Ground, Washington, 35 minutes north of Portland, Oregon. We manage another Etsy Shop, Engravingpro Engravingpro, LLC 20505 NE 221st CIR Battle Ground, WA 98604 Again, please contact us via &#39;Etsy Conversation&#39; -we check for new messages daily.",
