            creation_tsz: 1412565430,
            title: "Custom Vinyl Decals ",
            announcement: "*******CURRENT PRODUCTION TIME****** It&#39;s Vinyl Y&#39;all is your one stop shop for any vinyl decals you need. We can make anything from 1 decal to 100+ deals for your business and also can make car magnets, banners and more. ",
            currency_code: "USD",
            is_vacation: false,
            vacation_message: "WE&quot;RE MOVING! Please be patient with us as we are preparing to move next week. Our store will re-open on 6/1. If you have any questions please feel free to email us at itsvinylyall@gmail.com or call/text @ 601.533.8885. Thanks, Austin ",
            sale_message: "Thank you for choosing It&#39;s Vinyl Y&#39;all for your decal needs. Along with the decal(s) you ordered, you will also find an &quot;It&#39;s Vinyl Y&#39;all&quot; decal in your order because I always include a free decal with my purchases. You can use this as a “tester” to be sure that your decal is applied just right.I’m including some simple instructions below in the event that you haven’t used vinyl before as it is a bit different than a standard sticker. Step 1 Clean the area thoroughly with rubbing alcohol or soap and water. Do not use Windex or similar products because it will leave a residue behind that will prevent the sticker from adhering well. Step 2 Prepare the sticker for application by firmly rubbing a squeegee or credit card across the “top” transfer tape. This removes any air bubbles that may have formed and makes the sticker cling to the transfer tape. Step 3 Peel the white paper “back” backing off the sticker. If the sticker clings to the backing, slowly replace the paper backing and repeat Step 2. Step 4 Slowly lower the sticker onto the surface and rub it in place firmly with a squeegee or credit card. Step 5 Slowly peel the “top” clear transfer tape off at an angle. Be careful not to pull the sticker off the surface. If sticker pulls away from the surface repeat Step 4. **if you are satisfied with your purchase please give positive feedback on my store page. ",
